import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';
import { MainPage } from './Pages/MainPage';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <Routes>
          <Route path='/' element={<MainPage/>} />
        </Routes>        
      </div>
    </div>
  );
}

export default App;
